import * as React from 'react';
import {Card, Button} from 'react-bootstrap'

function Note()
{
    return (
        <>
        <Card>
            <Card.Body>
                <Card.Title> Titulo </Card.Title>
                <Card.Subtitle> 10/10/2020</Card.Subtitle>
                <Card.Text> Descrição</Card.Text>
                <Button variant = "danger">Excluir</Button>   
            </Card.Body>
        </Card>
        <br/>
       </>
    );
}
export default Note;
